		final long cartLevel = checkCartLevel(productModel, cartModel, pointOfServiceModel);
		final long stockLevel = getAvailableStockLevel(productModel, pointOfServiceModel);
		final boolean isMaxOrderQuantitySet = isMaxOrderQuantitySet(productModel.getMaxOrderQuantity());

		return wagoAdjustCartStrategy.allowedQuantityChangeForProduct(productModel, isMaxOrderQuantitySet, quantityToAdd, cartLevel,
				stockLevel);
	}

